Template.vokabelDetail.onCreated(function() {
  let self = this;
  self.autorun(function() {
    let vocableId = FlowRouter.getParam('id');
    self.subscribe('singlePost', vocableId);
  });
});

Template.vokabelDetail.helpers({
  vocable() {
    let vocableId = FlowRouter.getParam('id');
    let vocable = Vocabulary.findOne({_id: vocableId}) || {};
    console.log(vocable);
    return vocable;
  }
});
